
CREATE DATABASE /*!32312 IF NOT EXISTS*/ `rei_new` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;

USE `rei_new`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password` varchar(255) NOT NULL,
  `profile_picture` varchar(255) NOT NULL DEFAULT 'default_user.jpg',
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;
INSERT INTO `users` VALUES (1,'Pedro','piterchiva10@gmail.com','6018bfe4f438959a4cde25a8e7faf86a','default_user.jpg','2025-01-26 17:30:50'),(2,'Abraham','abraham.magana9121@alumnos.udg.mx','21232f297a57a5a743894a0e4a801fc3','default_user.jpg','2024-01-19 17:31:50'),(3,'Samuel','samuel.espinoza0177@alumnos.udg.mx','21232f297a57a5a743894a0e4a801fc3','default_user.jpg','2025-03-08 17:32:50'),(4,'Ricardo','ricardo.rodriguez1085@alumnos.udg.mx','21232f297a57a5a743894a0e4a801fc3','default_user.jpg','2025-03-08 17:33:50');
CREATE TABLE `notes` (
  `note_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `title` text NOT NULL,
  `content` text NOT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `remove_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`note_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `notes_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `products` (
  `product_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `image` varchar(255) NOT NULL DEFAULT 'default_product.jpg',
  `category` enum('Celular','Accesorio','Chip','Otro') NOT NULL,
  `description` text DEFAULT NULL,
  `price` float(10,2) NOT NULL,
  `stock` int(10) unsigned NOT NULL DEFAULT 0,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `repair_orders` (
  `repair_order_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `client_name` varchar(255) NOT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `delivered_at` timestamp NULL DEFAULT NULL,
  `model` varchar(255) NOT NULL,
  `service` varchar(255) NOT NULL,
  `observations` text DEFAULT NULL,
  `repair_details` text DEFAULT NULL,
  `post_details` text DEFAULT NULL,
  `cost` float(10,2) NOT NULL,
  `investment` float(10,2) NOT NULL DEFAULT 0.00,
  `status` enum('Pendiente','Entregado') NOT NULL DEFAULT 'Pendiente',
  PRIMARY KEY (`repair_order_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `repair_orders_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=114 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
