INSERT INTO `repair_orders` VALUES (1,1,'Tere ','2025-01-30 17:22:22','2025-02-04 17:38:42','Moto g22 ','Display ','El equipo esta doblado y se recomienda cambiar el marco','cambiamos display y marco como se recomendó ','display colocado bien y funcionando, desgaste de sus tapas ',800.00,290.00,'Entregado'),(3,1,'Mayel ','2025-01-30 17:32:31','2025-03-29 02:18:01','Redmi note 8','Display ','Comenta el cliente que el equipo se mojo','al abrir el equipo notamos sarro en el conector de carga, se precedió a dar limpieza con alcohol para evitar algún corto ','cambiamos display y verificamos que cargara normalmente ningún detalle mas.',500.00,180.00,'Entregado'),(5,1,'Miguel angel ','2025-01-30 17:45:34','2025-01-31 19:57:47','Samsung a02s','Display ','Marco desgastaso y el boton de encendido ya no funciona muy bien ','Es el equipo estaba muy sucio y el boto no hace click muy bien, le comentamos al cliente del detalle pero solo quiso cambiar el display ','Solo cambio de display y el botón de encendido esta muy dañado y se batalla ´para encender ',550.00,190.00,'Entregado'),(6,1,'Miguel angel','2025-01-30 17:49:32','2025-01-31 19:57:35','Moto e7i power ','Display ','Marcos desgastados y muy sucio en especial el centro de carga ','Algunas partes del marco se calleron al poner la pantalla pero pego bien ','cambio de pantalla bien colocamos cinta doble cara al display para asegurarnos que no se despegue ',500.00,143.00,'Entregado'),(7,1,'Carlos','2025-01-30 17:55:54','2025-02-06 00:18:05','Iphone 11','Display ','El cliente solicito una pantalla incell, estéticamente esta bien solo unos raspones en las esquinas pero son mínimos. ','al abrir el equipo para el cambio de pantalla notamos que no tiene los blindajes de los conectores de la batería y del face id','cambio de pantalla sin ningún problema, comentamos al cliente de los blindajes.',850.00,260.00,'Entregado'),(8,1,'Donovan','2025-01-30 17:58:50','2025-02-04 17:38:12','Moto e20','Display','Buena estética del equipo, solo un pequeño golpe de la parte superior del display izquierda ','el equipo es su primer reparación tenia sus sellos de garantía','detalles mínimos, la pantalla se coloco sin ningún problema y realizamos limpieza al centro de carga.',650.00,190.00,'Entregado'),(9,1,'Vanessa','2025-01-30 18:04:00','2025-02-13 20:51:55','Redmi 10a','Display ','El equipo tiene un pequeña quebrada en una esquina y por la parte trasera la tapa esta doblada ','limpieza general antes de poner la pantalla se enderezo la tapa trasera con un poco de calor ','cambio de display sin ningún problema ',550.00,220.00,'Entregado'),(10,1,'Estefania','2025-01-30 18:07:01',NULL,'Samaung a30','Display incell ','El equipo tiene la tapa trasera muy desgastada. Comentamos al cliente que al abrirlo se va a desgastar más ','Se compro una pantalla con marco pero la tapa si quedó muy desgastado ','Pantalla sin ningún problema, colocamos pegamento transparente para que no se viera tan mal ',650.00,220.00,'Pendiente'),(13,1,'Tere','2025-01-30 18:18:31','2025-02-13 20:51:43','Iphone 11','Diaplay incell','No tiene un cristal de la cámara y tiene varios golpes en la parte del marco delantera  ','cambio de pantalla sin ningún problema ','el marco que estaba golpeado era de la pantalla al colocar la nueva quedo sin detalle',850.00,260.00,'Entregado'),(14,1,'Joel Flores ','2025-01-31 19:50:45','2025-02-06 00:17:42','Samaung a80','Display ','Tiene la tapa trasera quebrada y menciona el cliente que la camara frontal no sale por completo','También se reparo el botón de encendido se desoldó de otro y Flex y se soldo al Flex dañado','para poder poner la pantalla necesitamos quitar todo el modulo de cámaras. display funcionando bien solo con el detalle de la tapa trasera pero el cliente no aprobó el cambio de tapa ',1850.00,1300.00,'Entregado'),(15,1,'Fabian','2025-02-04 17:39:58','2025-03-14 21:54:05','Moto e22','Display ','Desgaste de las tapas y marcos, muy golpeado del display y también no carga ','antes de poner pantalla limpiamos centro de carga y verificamos que cargue bien ','cambio de display sin ningún problema y también su carga ya es normal ',650.00,230.00,'Entregado'),(16,1,'Lupe','2025-02-06 18:55:14','2025-02-10 21:23:43','Huawei y9 prime','Display ','Desgaste en la tapa trasera y esquinas desgastadas ','al abrir el equipo esta muy desgastado en sus partes y también faltan tornillos ','cambio de pantalla sin ningún problema colocamos los tornillos faltantes y cinta a la tapa trasera ',550.00,181.00,'Entregado'),(18,1,'Samuel','2025-02-06 19:46:33','2025-02-17 18:52:01','Samsung a20s','Display','Equipo un poco golpeado de las esquinas y doblado del marco ','al hacer el cambio de pantalla se pudo enderezar el marco el único detalle no se pudo colocar la protección para que no entre polvo del auricular  ','pantalla colocada bien sin detalles ',650.00,162.00,'Entregado'),(20,1,'Alicia','2025-02-07 19:14:41','2025-02-24 19:18:10','Zte a51','Display ','Equipo maltratado de los marcos, no carga ','equipo muy maltratado comenta el cliente que cayo de dos pisos de altura al cargarlo carga muy lento ','Tiene falso en el conector de carga se noto ese detalle después de colocar la pantalla, informamos al cliente del detalle pero solo quiso el cambio de pantalla',450.00,181.00,'Entregado'),(21,1,'Marisol ','2025-02-10 21:24:41',NULL,'Moto g32','Display ','A vista solo tiene desgaste de las tapa traseras ','Al parecer ya tenía un reparación anterior tenía demasiado pegamento y fun un poco difícil quitar la tapa trasera ','Pantalla cambiada sin ningún problema, limpiamos el marco de la parte trasera y quitamos el exceso de pegamento para poder poner nuevo y quedará bien ',750.00,240.00,'Pendiente'),(22,1,'Ricardo ','2025-02-10 21:28:02','2025-02-13 20:51:15','Poco c40','Display ','comenta que se había cambiado el display pero en otra parte, notamos que la protección del polvo del auricular de arriba no lo tiene ','al abrir el equipo la batería no esta pegada y faltan tornillos ','cambio de display bien, se pego la batería con cinta doble cara y pusimos los tornillos faltantes ',490.00,240.00,'Entregado'),(23,1,'Gael','2025-02-11 19:14:59','2025-02-13 20:51:10','iPhone 11 pro max ','Display y tapa trasera ','el cliente solicito un pantalla de calidad oled y la tapa del mismo color ','para hacer el cambio de cristal fue necesario retirar las cámaras para evitar daño en ellas ','Pantalla y tapa colocados sin problema verificamos que sus cámaras funcionara bien y se entrego al cliente sin detalles después de la reparación ',1500.00,550.00,'Entregado'),(24,1,'María Elena ','2025-02-11 21:25:26','2025-02-17 18:51:43','Moto g7 power ','Centro de carga ','Tiene falso en el conector \r\nSe cambiara la placa completa ','al revisar el celular la placa de carga esta doblada, se forzó mucho al carga y es necesario el cambio ','se verifico con la placa nueva que cargara normal',220.00,80.00,'Entregado'),(26,1,'Lizette ','2025-02-13 00:06:05','2025-02-13 20:50:49','Moto e6s','Centro de carga ','Puerto de carga dañado ','no hubo necesidad de cambiar la placa de carga ','Se cambió centro de carga y quedó funcionado el 100',180.00,0.00,'Entregado'),(27,1,'Adulfo','2025-02-13 18:34:34',NULL,'Samsung a05s','Display y tapa ','Celular desgastado de los Marcos y su tapa trasera esta muy desgastada ','El cliente aprobó el cambio de tapa ','Cambio de pantalla bien y tapa trasera del mismo color colocamos cinta y pegamento a la tapa trasera ',850.00,300.00,'Pendiente'),(28,1,'Daniela ','2025-02-13 21:07:10','2025-02-14 22:13:19','Redmi note 8 pro','Display ','Equipo no carga y la tapa está quebrada ','el intentar carga el equipo notamos que el cargador no entra por completo, realizamos limpieza al conector','pantalla colocada y funcionando bien verificamos que cargue después de la limpieza ',680.00,230.00,'Entregado'),(29,1,'Víctor Manuel ','2025-02-13 21:09:14','2025-03-27 18:31:58','Moto g8 power ','Display ','Esquinas de los Marcos dañadas el el equipo ya lo han traigo más de dos veces por cambio de display ','Este celular ya tiene un problema en ocasiones no funciona el touch y no es problema de la pantalla ','Ya se le comentó al cliente del problema además ya tiene más de 4 relaciones de display en menos de un año ',550.00,250.00,'Entregado'),(30,1,'Ana Justo ','2025-02-13 21:11:22','2025-02-18 20:26:50','Huawei Y9 2019','Display ','Desgaste de los Marcos y falso en el pin de carga ','el pin de carga ya esta flojo y se batalla para carga, informamos el cliente del detalle de la carga pero solo autorizo el cambio de pantalla ','pantalla funcionando bien solo quedo con el detalle del centro de carga, el cliente esta informando.',480.00,200.00,'Entregado'),(31,1,'Santiago ','2025-02-17 18:53:04','2025-02-24 19:17:06','Moto g8 power lite ','Display ','Descaste de la tapa trasera y sus marcos ','al cambiar la pantalla dejo de dar touch se necesito cambiar por otra pantalla nueva ','con la pantalla cambiada ya no hubo problema quedo funcionando bien ',550.00,200.00,'Entregado'),(32,1,'Laura Patricia ','2025-02-18 20:29:17','2025-02-24 19:17:01','Huawei y9 2019 ','Display ','Equipo estéticamente bien solo desgaste de uso, marcos desgastados por uso ','no presento problemas, solo su cambio de pantalla ','pantalla colocada y funcionando bien se hicieron pruebas antes de entregar ',550.00,200.00,'Entregado'),(33,1,'Silvia','2025-02-21 17:39:44','2025-02-24 19:16:58','iPhone 11','Display ','El cliente pidió una pantalla incell ','Ninguno ','Ninguno ',850.00,370.00,'Entregado'),(34,1,'Muchacha ','2025-02-24 19:20:05','2025-03-04 18:16:18','iPhone 11 pro ','Display oled ','Equipo quebrado de la parte trasera ','','',1300.00,800.00,'Entregado'),(35,1,'Yajaira','2025-02-24 19:22:07','2025-02-28 17:25:09','Oppo reno 6 lite','Display incell ','Desgaste de marcos ','','',650.00,250.00,'Entregado'),(36,1,'Alejandro Chávez ','2025-02-24 19:59:55','2025-02-28 17:25:06','A52','Display incell ','Equipo desgastado de la tapa trasera ','','',700.00,280.00